## 1.Introdução
O presente trabalho teve como objetivo a digitalização, uniformização e disponibilização dos dados publicados nos Relatórios de Análises do mercado de Terras que são instrumentos de análise dos diferentes mercados fundiários estabelecidos no país realizadas pelas superintendências do INCRA - Instituto Nacional de Colonização e Reforma Agrária - em cada estado (BRASIL, 2014). O material que buscou-se digitalizar foram as PPRs - Planilhas de Preços Referenciais de Terras - disponibilizadas nesses relatórios, essas planilhas possuem os valores de referência usados pelo órgão com a finalidade de avaliar imóveis rurais de todo o país (BRASIL, 2014).

Os relatórios de Análise do Mercado de terra sintetizam informações de terra, nesse sentido, ocorre a separação de diferentes estados em várias Zonas Homogêneas para a finalidade de análise. Essas zonas Homogêneas são construídas por meio de um processo de clusterização (BRASIL, 2014). A clusterização ocorre em duas etapas: primeiro é aplicado o algoritmo de Ward para a definição do Número de Clusters, posteriormente, por meio de um algoritmo de K-means são feitos ajustes nas cidades de modo a adequar melhor os clusters.

A metodologia de Ward baseia-se na criação de partições que minimizem a Soma dos Quadrados dos Erros (SQE), ou seja, a soma das distâncias euclidianas quadráticas de cada amostra em relação ao centroide (média) do cluster, conforme a fórmula:

$$
ESS_k = \sum_{i=1}^{n} \| x_i - \bar{x}_k \|^2
$$

A otimização do procedimento de cluster é feito por meio do processo de "K-means". Esse algoritmo forma K grupos diversos de municípios que posteriormente serão modificados movendo cidades de um local ao outro de modo a maximizar ou minimizar a função, aumentando a qualidade do cluster( BRASIL,2014 ). As variáveis que são recomendadas para sereme levadas em conta durante o processo de formação agrupamentos (Zonas Homogêneas), pelas superintendências do INCRA, são as seguintes (BRASIL, 2014):


::: {.cell}

